const Admin = ({ navigation }) => {
  return (
    <View style={styles.h1}>
      <Text style={styles.text}>Administrador</Text>
      <Button
        title="Voltar"
        onPress={() => navigation.goBack()}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  text: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  h1:{
    marginTop: 10,
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  }
});

export default Admin;
